    // #10 File Name :: CTA video modal JS
    $(document).ready(function () {
        $(".cta_model_video a").on("click", function (evt) {
            var videoSrc = $(this).attr("href");
            if ($("#VideoTargetModal").length == 0) {
                var matches = videoSrc.match(/^.*(youtu.be\/|v\/|u\/\w\/|embed\/|watch\?v=|\&v=|\?v=)([^#\&\?]*).*/);

                if (matches) {
                    var htmlModalPopup = '<div class="modal" id="VideoTargetModal" tabindex="-1" role="dialog" aria-labelledby="VideoTargetModalLabel"><div class="modal-dialog modal-lg" role="document"><div class="modal-content"><div class="modal-header"><button type="button" class="close" data-dismiss="modal" aria-label="Close"><span aria-hidden="true">&times;</span></button></div><div class="modal-body"><div class="embed-responsive embed-responsive-16by9"><iframe class="vr-iframe embed-responsive-item" id="VideoTargetModalLabel" data-src="" src="" scrolling="no"></iframe></div></div></div></div></div>'
                    $(".root").append(htmlModalPopup);
                } else {
                    var htmlModalPopup = '<div class="modal" id="VideoTargetModal" tabindex="-1" role="dialog" aria-labelledby="VideoTargetModalLabel"><div class="modal-dialog modal-lg" role="document"><div class="modal-content"><div class="modal-header"><button type="button" class="close" data-dismiss="modal" aria-label="Close"><span aria-hidden="true">&times;</span></button></div><div class="modal-body"><div class="embed-responsive embed-responsive-16by9"><video controls="true" class="vr-iframe embed-responsive-item" id="VideoTargetModalLabel"><source  data-src="" src="" ></video></div></div></div></div></div>'
                    $(".root").append(htmlModalPopup);
                }


            }
            if (videoSrc.indexOf("youtube") != -1 || videoSrc.indexOf("scene7") != -1) {
                evt.preventDefault();
                $("#VideoTargetModal").modal("show");
                $("#VideoTargetModalLabel").attr({
                    "src": videoSrc,
                    "data-src": videoSrc
                });
            }
        });

        $('body').on('hidden.bs.modal', '#VideoTargetModal', function () {
            $("#VideoTargetModal").remove();
            $("#VideoTargetModalLabel").attr({
                "src": "",
                "data-src": ""
            });
        })
    });


