function updateTargetCartCount(){
    if(typeof $.ajax == "function"){
        var miniCartRes, miniCartQnty;
        if($("body").hasClass("order-confirmation")){
            // miniCartQnty = 0;
            // document.cookie = "MATTEL_CART_QUANTITY="+miniCartQnty+";path=/";
            return;
        }
        $.ajax({
            url: "/shop/MiniShopCartDisplayView?storeId=10651&catalogId=10601&langId=-1",
            type: "POST",
            data: "status=load&deleteCartCookie=true&objectId=&requesttype=ajax",
            success: function (res) {
                miniCartRes = $(res).find("#minishopcart_total").html();
                miniCartQnty = miniCartRes && parseInt(miniCartRes.trim() || 0);
                if(miniCartQnty){
                    $("#minishopcart_total").html(miniCartQnty).addClass("total-bag-count");
                    document.cookie = "MATTEL_CART_QUANTITY="+miniCartQnty+";path=/";
                }
            },
            error: function (err) {
                console.log(err.responseText)
            }
        })
    }
}
function targetEventBinding(){
    $(document).on('click','.promoBannerDrawer',function(){
        var a = $(".search-dropdown")
            , r = $(".search-overlay")
            , o = $(".nav-search #searchFormInput")
            , n = $(".nav-search .expand-search-bar");
        a.removeClass("open-dropdown"),
        r.removeClass("open-dropdown"),
        o.removeClass("in"),
        o.addClass("hide"),
        n.removeClass("hide")
    });

    if ($("body").hasClass("shop-cart")) {
        $(document).on("click", ".t_quick_view", function () {
            setTimeout(function () {$("#progress_bar").hide();}, 700);
        });
        $(document).on("click", "#WC_QuickInfo_Link_close", function () {
            $("body").css('position','')
        });
    }
            
}
function updateFloatingSection(){
	var $floatingSection = $('#floatingMyOrder');
	if (window.innerWidth >= 1024 && $floatingSection.length && $floatingSection.data('bs.affix') != undefined) {
		$floatingSection.data('bs.affix').options.offset.bottom = $("footer").height();
		$floatingSection.affix('checkPosition');
	}
}
function targetJSInit(){
    if (!AEMECOMM.FileLoaded) {
        targetJSLoaded = true;
        AEMECOMM.FileLoaded = true;
        loadTargetScript();
        console.log("AEM Bundled file loaded");
        updateTargetCartCount();
        typeof cursor_clear == "function" && cursor_clear();
        targetEventBinding();
        setTimeout(function(){
        	if(!$("body").hasClass("shop-cart")){
        		updateFloatingSection();
        	}
        },100);
    } else{
        console.log("JS File already loaded..returning..");
    }
}
if(typeof dojo !="undefined" && typeof dojo.addOnLoad == "function"){
    dojo.addOnLoad(function() {
        targetJSInit();
    });
}
window.addEventListener("load", function() {
    if(!targetJSLoaded){
        targetJSInit();
    }
    setTimeout(function(){typeof cursor_clear == "function" && cursor_clear();},1000);
});

var targetJSLoaded = false;